import React from 'react';
import NavBar from './NavBar';

class Home extends React.Component {
    render() {
        const currentPath = window.location.pathname
        console.log(currentPath)
        return (
            <div>
                <p>Hello world</p><br/><br/><br/><br/>
                <NavBar />
            </div>
        );
    }
}

export default Home;
